import React, { Component } from 'react'

export default class Card extends Component {
    render() {
        return (
            <div className="card">
                <img src="https://live.staticflickr.com/65535/49211596582_ea95c0a954_b.jpg" alt=""></img>
                <div className="card-container">
                    <h4><b>Ghost Of Tsushima</b></h4>
                    <p>General, Action Adventure, Open-World</p>
                </div>
            </div>
        )
    }
}
